Reisinformatie van het ministerie van Buitenlandse Zaken en de Douane. Direct bericht bij wijziging van het reisadvies van uw favoriete land.

Ga wijs op reis met de Reisapp. 
Met de app:
- Bekijkt u de actuele reisadviezen;
- Controleert u wat u wel of niet zo maar mee mag nemen in uw reisbagage. In de app leest u de regels over het meenemen van geneesmiddelen, geld, etenswaren, drank, tabak, dieren, planten, bedragen hoger dan € 10.000 of dure producten. Binnen de EU gelden er andere regels dan buiten de EU;
- Leest u over wat u moet doen bij noodgevallen, zoals opname in het ziekenhuis, overlijden, arrestatie etc. Ook heeft u meteen de contactgegevens van het ministerie van Buitenlandse Zaken in Den Haag bij de hand;
- Kunt u valuta, volume en gewicht naar euro’s en in Nederland gangbare eenheden (zoals kg en liter) omrekenen;
- Kunt u aankoopbonnen in het bonnenboekje bewaren van eerder gekochte producten van grotere waarde (> € 430), die u mee op reis neemt. Zo kunt u bij terugkomst in Nederland laten zien dat u deze producten voor u op reis ging al had gekocht, en voorkomt u vervelende situaties;
- Zoekt u de vertegenwoordiging (Nederlandse ambassades, consulaten-generaal, honoraire consulaten) in een land op.

Maak een land favoriet zodat u:
- automatisch een push-bericht ontvangt zodra het reisadvies voor dat land is aangepast. Zo bent u altijd op de hoogte van de actuele veiligheidssituatie in het buitenland.
- ook zonder internetverbinding alle reisinformatie kunt nalezen. Voor het bijwerken naar de laatste reisinformatie heeft u wel een internetverbinding nodig.

Reis je met het openbaar vervoer in de regio Rotterdam? In de nieuwe RET App vind je alles in één app: reisinformatie en tickets voor vervoer met de RET.

De RET App toont je de actuele vertrektijden voor de dichtstbijzijnde haltes en voor jouw lijnen. Ontvang een push-bericht bij een omleiding of actuele verstoring op de lijnen die je wilt volgen.


Met de routeplanner plan je een reis met het OV vanaf je huidige locatie of een zelfgekozen adres naar iedere bestemming in heel Nederland. De reisplanner geeft een reisadvies met actuele vertrektijden voor bus, tram, metro en trein.

Waarom de RET App gebruiken?
- Super snel een barcode ticket kopen voor vervoer met RET bussen, trams en metro;
- Actuele vertrektijden op je favoriete lijn en halte en in de routeplanner;
- Actuele informatie over beschikbare deelmobiliteit;
- Actuele weersverwachtingen in Rotterdam;
- Push-bericht bij een omleiding of verstoring op jouw lijn;
- Overzicht van alle omleidingen voor bus, tram & metro en verstoringen aan liften en roltrappen;
- Klantenservice.
